        // property, event, createMainFrame
        this.on_initApplication = function()
        {
            // properties
            this.set_id("nxui");
            this.set_version("");
            this.set_tracemode("");
            this.set_loadingimage("image::waitimage.gif");
            this.set_networksecurelevel("0");
            this.set_filesecurelevel("0");
            this.set_themeid("nxui.xtheme");
            this.set_enabletouchevent("true");

            if (this._is_attach_childframe)
            	return;

            // frame
            var mainframe = this.createMainFrame("mainframe", "absolute", null, null, "1260", "571", null, null, this);
            mainframe.set_resizable("true");
            mainframe.set_showtitlebar("false");
            mainframe.set_showstatusbar("false");
            mainframe.set_visible("true");
            mainframe.set_titletext("넥센타이어 영업관리시스템");
            mainframe.style.set_icon("URL('image::nexacro.ico')");
            mainframe.on_createBodyFrame = this.mainframe_createBodyFrame;

            // tray
            var tray = null;

        };
        

        
        this.mainframe_createBodyFrame = function()
        {
            var obj = new ChildFrame("index", "absolute", null, null, null, null, null, null, "frame::index.xfdl", this);
            this.addChild(obj.name, obj);
            this.frame = obj;

            obj.set_formurl("frame::index.xfdl");
            obj.set_showtitlebar("false");
            obj = null;

        };
        
        this.on_initEvent = function()
        {
            this.addEventHandler("onload", this.application_onload, this);
            this.addEventHandler("onerror", this.application_onerror, this);
            this.addEventHandler("onbeforeexit", this.application_onbeforeexit, this);
            this.mainframe.addEventHandler("onsize", this.MainFrame_onsize, this);

        };
        
